wwv_flow_api.create_plugin_attribute(
 p_id=>wwv_flow_api.id(46733739294192350)
,p_plugin_id=>wwv_flow_api.id(46691325678784912)
,p_attribute_scope=>'COMPONENT'
,p_attribute_sequence=>3
,p_display_sequence=>30
,p_prompt=>'Title Media URL'
,p_attribute_type=>'TEXT'
,p_is_required=>false
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_is_translatable=>false
,p_help_text=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'<p>Usually a link to an image but it is also possible to link to many different webpages. If a link to one of the supported pages is used, the plugin will embed content from the link in a way that is useful. e.g. youtube links will embed a youtube pl'
||'ayer and twitter links will embed the tweet with complete markup.</p>',
'',
'<ul>',
'<li>Flickr</li>',
'<li>Instagram</li>',
'<li>Images</li>',
'<li>Vimeo</li>',
'<li>YouTube</li>',
'<li>Vine</li>',
